import React from 'react';

const Results = (searchResults) => {

    return (
        <div className="search-result">
            <table>
                <tr>
                    <th>Kit ID</th>
                    <th>Shipping Number</th>
                </tr>
                    {searchResults.map((data) => (
                        <tr>
                        <td>{data.label_id}</td>
                        <td>{data.shipping_tracking_code}</td>
                        </tr>
                    ))}            
            </table>
        </div>
    );
}

export default Results;
